import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Subscription = () => {
  const navigate = useNavigate();

  const plans = [
    {
      name: "Basic Plan",
      price: 5.99,
      features: ["SD Streaming", "1 Device", "No Downloads"]
    },
    {
      name: "Standard Plan",
      price: 9.99,
      features: ["HD Streaming", "2 Devices", "Downloads Available"]
    },
    {
      name: "Premium Plan",
      price: 14.99,
      features: ["Ultra HD & 4K Streaming", "4 Devices", "Unlimited Downloads"]
    }
  ];

  const handlePlanSelect = (plan) => {
    navigate("/payment", { state: { planDetails: plan } });
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center text-center p-6">
      {/* Title & Subtitle */}
      <div className="mb-4">
        <h2 className="text-3xl font-bold">Choose Your Plan</h2>
        <p className="mt-2 text-lg">Pay using Card, PayPal, or Rocket Credits.</p>
      </div>

      {/* Single Row, 3 Columns (Table Centered) */}
      <div className="subscription-plans-container">
        <table className="table-auto">
          <tbody>
            <tr>
              {plans.map((plan, index) => (
                <td key={index} className="align-top p-4">
                  <div className="border p-6 rounded-lg shadow-lg bg-gray-800 w-72">
                    <h3 className="text-xl font-bold">{plan.name}</h3>
                    <p className="text-gray-300">${plan.price} / month</p>
                    <ul className="mt-4 text-gray-400 list-none">
                      {plan.features.map((feature, i) => (
                        <li key={i}>{feature}</li>
                      ))}
                    </ul>
                    <button
                      onClick={() => handlePlanSelect(plan)}
                      className="mt-4 inline-block bg-green-600 text-white px-6 py-3 rounded text-lg w-full"
                    >
                      Choose Plan
                    </button>
                  </div>
                </td>
              ))}
            </tr>
          </tbody>
        </table>
      </div>

      {/* Payment Method Icons */}
      <div className="flex justify-center gap-10 mt-6">
        <img src="/images/card.png" alt="Credit Card" className="payment-icon card" />
        <img src="/images/paypal.png" alt="PayPal" className="payment-icon paypal" />
        <img src="/images/rocket.png" alt="Rocket Credits" className="payment-icon rocket" />
      </div>

      {/* Rocket Credits Information */}
      <div className="mt-8 max-w-2xl mx-auto bg-gray-800 p-6 rounded-lg shadow-lg">
        <h3 className="text-xl font-bold mb-4">About Rocket Credits</h3>
        <p className="mb-4">
          Rocket Credits are our virtual currency that can be used to purchase subscriptions at a discounted rate.
        </p>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div className="bg-gray-700 p-4 rounded">
            <h4 className="font-semibold mb-2">Benefits</h4>
            <ul className="text-left text-gray-300 list-disc pl-5">
              <li>Save up to 15% compared to regular payment methods</li>
              <li>Eligible for our money-back guarantee program</li>
              <li>Earn bonus credits with each subscription renewal</li>
            </ul>
          </div>
          <div className="bg-gray-700 p-4 rounded">
            <h4 className="font-semibold mb-2">Money-Back Guarantee</h4>
            <p className="text-left text-gray-300 text-sm">
              When paying with Rocket Credits, you can select a return date during checkout. 
              If you cancel before your selected date, you'll receive a partial refund of your credits.
              The sooner you cancel, the higher percentage you get back!
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Subscription;
